// eslint-disable-next-line
import React from "react";
import Card from "./Card";
import contact from "../contacts";

function createCard(contact) {
  return (
    <Card
      key={contact.id}
      name={contact.name}
      img={contact.imgURL}
      tel={contact.phone}
      email={contact.email}
    />
  );
}


function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      {contact.map((createCard))}
    </div>
  );
}

export default App;
